            <toolbar>
                <button id="voltar" onClick="/"></button>
                <h1>Cadastrar</h1>
                <Link>Confirmar</Link>
            </toolbar>
            <form onSubmit ={handleSubmit}>
                <img src={logo} alt="Danimali" />
                <input 
                    value={username}
                    onChange={e => setUserName(e.target.value)}/>
                <input type="password" />
                <button id="entrar" type="submit">Entrar</button>              
                <button id="cadastrar" onClick="/cadastrar">Cadastrar</button>
                <button id="facebook" onClick="/main"></button>
                <h1><u>Esquici minha senha</u></h1>
            </form>
            </div>

    );
}
